{"query":"query getDescriptorsBySynonym(
	$synonym: String!,
	$limit: Int,
) {
  descriptors {
    bySynonym(
			synonym: $synonym,
			limit: $limit,
		) {
      descriptorId,
      descriptorClass,
			ui,
			name,
			created,
			revised,
			established,
			synonyms {
				synonym
			},
    }
  }
}
","variables":{"synonym":"brain cancer","limit":10},"operationName":"getDescriptorsBySynonym"}
